@testset "7.4.1 Inverse hyperbolic cotangent functions" begin
    (a, b, c, d, e, f, g, m, n, x, ) = @variables a b c d e f g m n x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*involving*inverse*hyperbolic*cotangents=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*u*acoth(a*x)^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*acoth(a*x)^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [x^5*acoth(a*x), x, 4, x/(6*a^5) + x^3/(18*a^3) + x^5/(30*a) + (1/6)*x^6*acoth(a*x) - atanh(a*x)/(6*a^6)]
    @test_int [x^4*acoth(a*x), x, 4, x^2/(10*a^3) + x^4/(20*a) + (1/5)*x^5*acoth(a*x) + log(1 - a^2*x^2)/(10*a^5)]
    @test_int [x^3*acoth(a*x), x, 4, x/(4*a^3) + x^3/(12*a) + (1/4)*x^4*acoth(a*x) - atanh(a*x)/(4*a^4)]
    @test_int [x^2*acoth(a*x), x, 4, x^2/(6*a) + (1/3)*x^3*acoth(a*x) + log(1 - a^2*x^2)/(6*a^3)]
    @test_int [x^1*acoth(a*x), x, 3, x/(2*a) + (1/2)*x^2*acoth(a*x) - atanh(a*x)/(2*a^2)]
    @test_int [x^0*acoth(a*x), x, 2, x*acoth(a*x) + log(1 - a^2*x^2)/(2*a)]
    @test_int [acoth(a*x)/x^1, x, 1, (1/2)*PolyLog(2, -(1/(a*x))) - (1/2)*PolyLog(2, 1/(a*x))]
    @test_int [acoth(a*x)/x^2, x, 5, -(acoth(a*x)/x) + a*log(x) - (1/2)*a*log(1 - a^2*x^2)]
    @test_int [acoth(a*x)/x^3, x, 3, -(a/(2*x)) - acoth(a*x)/(2*x^2) + (1/2)*a^2*atanh(a*x)]
    @test_int [acoth(a*x)/x^4, x, 4, -(a/(6*x^2)) - acoth(a*x)/(3*x^3) + (1/3)*a^3*log(x) - (1/6)*a^3*log(1 - a^2*x^2)]
    @test_int [acoth(a*x)/x^5, x, 4, -(a/(12*x^3)) - a^3/(4*x) - acoth(a*x)/(4*x^4) + (1/4)*a^4*atanh(a*x)]


    @test_int [x^5*acoth(a*x)^2, x, 15, (4*x^2)/(45*a^4) + x^4/(60*a^2) + (x*acoth(a*x))/(3*a^5) + (x^3*acoth(a*x))/(9*a^3) + (x^5*acoth(a*x))/(15*a) - acoth(a*x)^2/(6*a^6) + (1/6)*x^6*acoth(a*x)^2 + (23*log(1 - a^2*x^2))/(90*a^6)]
    @test_int [x^4*acoth(a*x)^2, x, 14, (3*x)/(10*a^4) + x^3/(30*a^2) + (x^2*acoth(a*x))/(5*a^3) + (x^4*acoth(a*x))/(10*a) + acoth(a*x)^2/(5*a^5) + (1/5)*x^5*acoth(a*x)^2 - (3*atanh(a*x))/(10*a^5) - (2*acoth(a*x)*log(2/(1 - a*x)))/(5*a^5) - PolyLog(2, 1 - 2/(1 - a*x))/(5*a^5)]
    @test_int [x^3*acoth(a*x)^2, x, 10, x^2/(12*a^2) + (x*acoth(a*x))/(2*a^3) + (x^3*acoth(a*x))/(6*a) - acoth(a*x)^2/(4*a^4) + (1/4)*x^4*acoth(a*x)^2 + log(1 - a^2*x^2)/(3*a^4)]
    @test_int [x^2*acoth(a*x)^2, x, 9, x/(3*a^2) + (x^2*acoth(a*x))/(3*a) + acoth(a*x)^2/(3*a^3) + (1/3)*x^3*acoth(a*x)^2 - atanh(a*x)/(3*a^3) - (2*acoth(a*x)*log(2/(1 - a*x)))/(3*a^3) - PolyLog(2, 1 - 2/(1 - a*x))/(3*a^3)]
    @test_int [x^1*acoth(a*x)^2, x, 5, (x*acoth(a*x))/a - acoth(a*x)^2/(2*a^2) + (1/2)*x^2*acoth(a*x)^2 + log(1 - a^2*x^2)/(2*a^2)]
    @test_int [x^0*acoth(a*x)^2, x, 5, acoth(a*x)^2/a + x*acoth(a*x)^2 - (2*acoth(a*x)*log(2/(1 - a*x)))/a - PolyLog(2, 1 - 2/(1 - a*x))/a]
    @test_int [acoth(a*x)^2/x^1, x, 6, 2*acoth(a*x)^2*acoth(1 - 2/(1 - a*x)) + acoth(a*x)*PolyLog(2, 1 - 2/(1 + a*x)) - acoth(a*x)*PolyLog(2, 1 - (2*a*x)/(1 + a*x)) + (1/2)*PolyLog(3, 1 - 2/(1 + a*x)) - (1/2)*PolyLog(3, 1 - (2*a*x)/(1 + a*x))]
    @test_int [acoth(a*x)^2/x^2, x, 4, a*acoth(a*x)^2 - acoth(a*x)^2/x + 2*a*acoth(a*x)*log(2 - 2/(1 + a*x)) - a*PolyLog(2, -1 + 2/(1 + a*x))]
    @test_int [acoth(a*x)^2/x^3, x, 8, -((a*acoth(a*x))/x) + (1/2)*a^2*acoth(a*x)^2 - acoth(a*x)^2/(2*x^2) + a^2*log(x) - (1/2)*a^2*log(1 - a^2*x^2)]
    @test_int [acoth(a*x)^2/x^4, x, 8, -(a^2/(3*x)) - (a*acoth(a*x))/(3*x^2) + (1/3)*a^3*acoth(a*x)^2 - acoth(a*x)^2/(3*x^3) + (1/3)*a^3*atanh(a*x) + (2/3)*a^3*acoth(a*x)*log(2 - 2/(1 + a*x)) - (1/3)*a^3*PolyLog(2, -1 + 2/(1 + a*x))]
    @test_int [acoth(a*x)^2/x^5, x, 13, -(a^2/(12*x^2)) - (a*acoth(a*x))/(6*x^3) - (a^3*acoth(a*x))/(2*x) + (1/4)*a^4*acoth(a*x)^2 - acoth(a*x)^2/(4*x^4) + (2/3)*a^4*log(x) - (1/3)*a^4*log(1 - a^2*x^2)]


    @test_int [x^5*acoth(a*x)^3, x, 33, (19*x)/(60*a^5) + x^3/(60*a^3) + (4*x^2*acoth(a*x))/(15*a^4) + (x^4*acoth(a*x))/(20*a^2) + (23*acoth(a*x)^2)/(30*a^6) + (x*acoth(a*x)^2)/(2*a^5) + (x^3*acoth(a*x)^2)/(6*a^3) + (x^5*acoth(a*x)^2)/(10*a) - acoth(a*x)^3/(6*a^6) + (1/6)*x^6*acoth(a*x)^3 - (19*atanh(a*x))/(60*a^6) - (23*acoth(a*x)*log(2/(1 - a*x)))/(15*a^6) - (23*PolyLog(2, 1 - 2/(1 - a*x)))/(30*a^6)]
    @test_int [x^4*acoth(a*x)^3, x, 22, x^2/(20*a^3) + (9*x*acoth(a*x))/(10*a^4) + (x^3*acoth(a*x))/(10*a^2) - (9*acoth(a*x)^2)/(20*a^5) + (3*x^2*acoth(a*x)^2)/(10*a^3) + (3*x^4*acoth(a*x)^2)/(20*a) + acoth(a*x)^3/(5*a^5) + (1/5)*x^5*acoth(a*x)^3 - (3*acoth(a*x)^2*log(2/(1 - a*x)))/(5*a^5) + log(1 - a^2*x^2)/(2*a^5) - (3*acoth(a*x)*PolyLog(2, 1 - 2/(1 - a*x)))/(5*a^5) + (3*PolyLog(3, 1 - 2/(1 - a*x)))/(10*a^5)]
    @test_int [x^3*acoth(a*x)^3, x, 18, x/(4*a^3) + (x^2*acoth(a*x))/(4*a^2) + acoth(a*x)^2/a^4 + (3*x*acoth(a*x)^2)/(4*a^3) + (x^3*acoth(a*x)^2)/(4*a) - acoth(a*x)^3/(4*a^4) + (1/4)*x^4*acoth(a*x)^3 - atanh(a*x)/(4*a^4) - (2*acoth(a*x)*log(2/(1 - a*x)))/a^4 - PolyLog(2, 1 - 2/(1 - a*x))/a^4]
    @test_int [x^2*acoth(a*x)^3, x, 11, (x*acoth(a*x))/a^2 - acoth(a*x)^2/(2*a^3) + (x^2*acoth(a*x)^2)/(2*a) + acoth(a*x)^3/(3*a^3) + (1/3)*x^3*acoth(a*x)^3 - (acoth(a*x)^2*log(2/(1 - a*x)))/a^3 + log(1 - a^2*x^2)/(2*a^3) - (acoth(a*x)*PolyLog(2, 1 - 2/(1 - a*x)))/a^3 + PolyLog(3, 1 - 2/(1 - a*x))/(2*a^3)]
    @test_int [x^1*acoth(a*x)^3, x, 8, (3*acoth(a*x)^2)/(2*a^2) + (3*x*acoth(a*x)^2)/(2*a) - acoth(a*x)^3/(2*a^2) + (1/2)*x^2*acoth(a*x)^3 - (3*acoth(a*x)*log(2/(1 - a*x)))/a^2 - (3*PolyLog(2, 1 - 2/(1 - a*x)))/(2*a^2)]
    @test_int [x^0*acoth(a*x)^3, x, 5, acoth(a*x)^3/a + x*acoth(a*x)^3 - (3*acoth(a*x)^2*log(2/(1 - a*x)))/a - (3*acoth(a*x)*PolyLog(2, 1 - 2/(1 - a*x)))/a + (3*PolyLog(3, 1 - 2/(1 - a*x)))/(2*a)]
    @test_int [acoth(a*x)^3/x^1, x, 8, 2*acoth(a*x)^3*acoth(1 - 2/(1 - a*x)) + (3/2)*acoth(a*x)^2*PolyLog(2, 1 - 2/(1 + a*x)) - (3/2)*acoth(a*x)^2*PolyLog(2, 1 - (2*a*x)/(1 + a*x)) + (3/2)*acoth(a*x)*PolyLog(3, 1 - 2/(1 + a*x)) - (3/2)*acoth(a*x)*PolyLog(3, 1 - (2*a*x)/(1 + a*x)) + (3/4)*PolyLog(4, 1 - 2/(1 + a*x)) - (3/4)*PolyLog(4, 1 - (2*a*x)/(1 + a*x))]
    @test_int [acoth(a*x)^3/x^2, x, 5, a*acoth(a*x)^3 - acoth(a*x)^3/x + 3*a*acoth(a*x)^2*log(2 - 2/(1 + a*x)) - 3*a*acoth(a*x)*PolyLog(2, -1 + 2/(1 + a*x)) - (3/2)*a*PolyLog(3, -1 + 2/(1 + a*x))]
    @test_int [acoth(a*x)^3/x^3, x, 7, (3/2)*a^2*acoth(a*x)^2 - (3*a*acoth(a*x)^2)/(2*x) + (1/2)*a^2*acoth(a*x)^3 - acoth(a*x)^3/(2*x^2) + 3*a^2*acoth(a*x)*log(2 - 2/(1 + a*x)) - (3/2)*a^2*PolyLog(2, -1 + 2/(1 + a*x))]
    @test_int [acoth(a*x)^3/x^4, x, 14, -((a^2*acoth(a*x))/x) + (1/2)*a^3*acoth(a*x)^2 - (a*acoth(a*x)^2)/(2*x^2) + (1/3)*a^3*acoth(a*x)^3 - acoth(a*x)^3/(3*x^3) + a^3*log(x) - (1/2)*a^3*log(1 - a^2*x^2) + a^3*acoth(a*x)^2*log(2 - 2/(1 + a*x)) - a^3*acoth(a*x)*PolyLog(2, -1 + 2/(1 + a*x)) - (1/2)*a^3*PolyLog(3, -1 + 2/(1 + a*x))]
    @test_int [acoth(a*x)^3/x^5, x, 16, -(a^3/(4*x)) - (a^2*acoth(a*x))/(4*x^2) + a^4*acoth(a*x)^2 - (a*acoth(a*x)^2)/(4*x^3) - (3*a^3*acoth(a*x)^2)/(4*x) + (1/4)*a^4*acoth(a*x)^3 - acoth(a*x)^3/(4*x^4) + (1/4)*a^4*atanh(a*x) + 2*a^4*acoth(a*x)*log(2 - 2/(1 + a*x)) - a^4*PolyLog(2, -1 + 2/(1 + a*x))]


    #= ::Subsubsection:: =#
    #=n<0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*acoth(c*x))^n=#


    @test_int [acoth(c*x)^2/(d + e*x), x, 1, -((acoth(c*x)^2*log(2/(1 + c*x)))/e) + (acoth(c*x)^2*log((2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/e + (acoth(c*x)*PolyLog(2, 1 - 2/(1 + c*x)))/e - (acoth(c*x)*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/e + PolyLog(3, 1 - 2/(1 + c*x))/(2*e) - PolyLog(3, 1 - (2*c*(d + e*x))/((c*d + e)*(1 + c*x)))/(2*e)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*acoth(a*x)*(c+d*x^2)^p=#


    @test_int [acoth(a*x)*(c + d*x^2)^4, x, 4, (d*(420*a^6*c^3 + 378*a^4*c^2*d + 180*a^2*c*d^2 + 35*d^3)*x^2)/(630*a^7) + (d^2*(378*a^4*c^2 + 180*a^2*c*d + 35*d^2)*x^4)/(1260*a^5) + (d^3*(36*a^2*c + 7*d)*x^6)/(378*a^3) + (d^4*x^8)/(72*a) + c^4*x*acoth(a*x) + (4/3)*c^3*d*x^3*acoth(a*x) + (6/5)*c^2*d^2*x^5*acoth(a*x) + (4/7)*c*d^3*x^7*acoth(a*x) + (1/9)*d^4*x^9*acoth(a*x) + ((315*a^8*c^4 + 420*a^6*c^3*d + 378*a^4*c^2*d^2 + 180*a^2*c*d^3 + 35*d^4)*log(1 - a^2*x^2))/(630*a^9)]
    @test_int [acoth(a*x)*(c + d*x^2)^3, x, 4, (d*(35*a^4*c^2 + 21*a^2*c*d + 5*d^2)*x^2)/(70*a^5) + (d^2*(21*a^2*c + 5*d)*x^4)/(140*a^3) + (d^3*x^6)/(42*a) + c^3*x*acoth(a*x) + c^2*d*x^3*acoth(a*x) + (3/5)*c*d^2*x^5*acoth(a*x) + (1/7)*d^3*x^7*acoth(a*x) + ((35*a^6*c^3 + 35*a^4*c^2*d + 21*a^2*c*d^2 + 5*d^3)*log(1 - a^2*x^2))/(70*a^7)]
    @test_int [acoth(a*x)*(c + d*x^2)^2, x, 5, (d*(10*a^2*c + 3*d)*x^2)/(30*a^3) + (d^2*x^4)/(20*a) + c^2*x*acoth(a*x) + (2/3)*c*d*x^3*acoth(a*x) + (1/5)*d^2*x^5*acoth(a*x) + ((15*a^4*c^2 + 10*a^2*c*d + 3*d^2)*log(1 - a^2*x^2))/(30*a^5)]
    @test_int [acoth(a*x)*(c + d*x^2)^1, x, 5, (d*x^2)/(6*a) + c*x*acoth(a*x) + (1/3)*d*x^3*acoth(a*x) + ((3*a^2*c + d)*log(1 - a^2*x^2))/(6*a^3)]
    @test_int [acoth(a*x)/(c + d*x^2)^1, x, 27, -((atan((sqrt(d)*x)/sqrt(c))*log(1 - 1/(a*x)))/(2*sqrt(c)*sqrt(d))) + (atan((sqrt(d)*x)/sqrt(c))*log(1 + 1/(a*x)))/(2*sqrt(c)*sqrt(d)) + (atan((sqrt(d)*x)/sqrt(c))*log(-((2*sqrt(c)*sqrt(d)*(1 - a*x))/((im*a*sqrt(c) - sqrt(d))*(sqrt(c) - im*sqrt(d)*x)))))/(2*sqrt(c)*sqrt(d)) - (atan((sqrt(d)*x)/sqrt(c))*log((2*sqrt(c)*sqrt(d)*(1 + a*x))/((im*a*sqrt(c) + sqrt(d))*(sqrt(c) - im*sqrt(d)*x))))/(2*sqrt(c)*sqrt(d)) - (im*PolyLog(2, 1 + (2*sqrt(c)*sqrt(d)*(1 - a*x))/((im*a*sqrt(c) - sqrt(d))*(sqrt(c) - im*sqrt(d)*x))))/(4*sqrt(c)*sqrt(d)) + (im*PolyLog(2, 1 - (2*sqrt(c)*sqrt(d)*(1 + a*x))/((im*a*sqrt(c) + sqrt(d))*(sqrt(c) - im*sqrt(d)*x))))/(4*sqrt(c)*sqrt(d))]
    @test_int [acoth(a*x)/(c + d*x^2)^2, x, If(13<11, 24, 25), (x*acoth(a*x))/(2*c*(c + d*x^2)) + (acoth(a*x)*atan((sqrt(d)*x)/sqrt(c)))/(2*c^(3/2)*sqrt(d)) + (im*log((sqrt(d)*(1 - a*x))/(im*a*sqrt(c) + sqrt(d)))*log(1 - (im*sqrt(d)*x)/sqrt(c)))/(8*c^(3/2)*sqrt(d)) - (im*log(-((sqrt(d)*(1 + a*x))/(im*a*sqrt(c) - sqrt(d))))*log(1 - (im*sqrt(d)*x)/sqrt(c)))/(8*c^(3/2)*sqrt(d)) - (im*log(-((sqrt(d)*(1 - a*x))/(im*a*sqrt(c) - sqrt(d))))*log(1 + (im*sqrt(d)*x)/sqrt(c)))/(8*c^(3/2)*sqrt(d)) + (im*log((sqrt(d)*(1 + a*x))/(im*a*sqrt(c) + sqrt(d)))*log(1 + (im*sqrt(d)*x)/sqrt(c)))/(8*c^(3/2)*sqrt(d)) + (a*log(1 - a^2*x^2))/(4*c*(a^2*c + d)) - (a*log(c + d*x^2))/(4*c*(a^2*c + d)) + (im*PolyLog(2, (a*(sqrt(c) - im*sqrt(d)*x))/(a*sqrt(c) - im*sqrt(d))))/(8*c^(3/2)*sqrt(d)) - (im*PolyLog(2, (a*(sqrt(c) - im*sqrt(d)*x))/(a*sqrt(c) + im*sqrt(d))))/(8*c^(3/2)*sqrt(d)) + (im*PolyLog(2, (a*(sqrt(c) + im*sqrt(d)*x))/(a*sqrt(c) - im*sqrt(d))))/(8*c^(3/2)*sqrt(d)) - (im*PolyLog(2, (a*(sqrt(c) + im*sqrt(d)*x))/(a*sqrt(c) + im*sqrt(d))))/(8*c^(3/2)*sqrt(d))]
    @test_int [acoth(a*x)/(c + d*x^2)^3, x, 23, a/(8*c*(a^2*c + d)*(c + d*x^2)) + (x*acoth(a*x))/(4*c*(c + d*x^2)^2) + (3*x*acoth(a*x))/(8*c^2*(c + d*x^2)) + (3*acoth(a*x)*atan((sqrt(d)*x)/sqrt(c)))/(8*c^(5/2)*sqrt(d)) + (3*im*log((sqrt(d)*(1 - a*x))/(im*a*sqrt(c) + sqrt(d)))*log(1 - (im*sqrt(d)*x)/sqrt(c)))/(32*c^(5/2)*sqrt(d)) - (3*im*log(-((sqrt(d)*(1 + a*x))/(im*a*sqrt(c) - sqrt(d))))*log(1 - (im*sqrt(d)*x)/sqrt(c)))/(32*c^(5/2)*sqrt(d)) - (3*im*log(-((sqrt(d)*(1 - a*x))/(im*a*sqrt(c) - sqrt(d))))*log(1 + (im*sqrt(d)*x)/sqrt(c)))/(32*c^(5/2)*sqrt(d)) + (3*im*log((sqrt(d)*(1 + a*x))/(im*a*sqrt(c) + sqrt(d)))*log(1 + (im*sqrt(d)*x)/sqrt(c)))/(32*c^(5/2)*sqrt(d)) + (a*(5*a^2*c + 3*d)*log(1 - a^2*x^2))/(16*c^2*(a^2*c + d)^2) - (a*(5*a^2*c + 3*d)*log(c + d*x^2))/(16*c^2*(a^2*c + d)^2) + (3*im*PolyLog(2, (a*(sqrt(c) - im*sqrt(d)*x))/(a*sqrt(c) - im*sqrt(d))))/(32*c^(5/2)*sqrt(d)) - (3*im*PolyLog(2, (a*(sqrt(c) - im*sqrt(d)*x))/(a*sqrt(c) + im*sqrt(d))))/(32*c^(5/2)*sqrt(d)) + (3*im*PolyLog(2, (a*(sqrt(c) + im*sqrt(d)*x))/(a*sqrt(c) - im*sqrt(d))))/(32*c^(5/2)*sqrt(d)) - (3*im*PolyLog(2, (a*(sqrt(c) + im*sqrt(d)*x))/(a*sqrt(c) + im*sqrt(d))))/(32*c^(5/2)*sqrt(d))]


    @test_int [acoth(a*x)*(c + d*x^2)^(1/2), x, 0, Unintegrable(sqrt(c + d*x^2)*acoth(a*x), x)]
    @test_int [acoth(a*x)/(c + d*x^2)^(1/2), x, 0, Unintegrable(acoth(a*x)/sqrt(c + d*x^2), x)]
    @test_int [acoth(a*x)/(c + d*x^2)^(3/2), x, 5, (x*acoth(a*x))/(c*sqrt(c + d*x^2)) - atanh((a*sqrt(c + d*x^2))/sqrt(a^2*c + d))/(c*sqrt(a^2*c + d))]
